import React, { useContext } from 'react';
import Card from '../Components/Card';
import {ContextGlobal} from '../Components/utils/global.context';

const Home = () => {

  const { contextValue } = useContext(ContextGlobal);
  const { state } = contextValue;


  return (
    <main className={state.theme}>
      <h1 id="h1home">Choose your favorites</h1>
      <div className='card-grid'>
        {Array.isArray(state.data) && state.data.map((pokemon) => (
          <Card key={pokemon.id} name={pokemon.name} username={pokemon.username} id={pokemon.id} />
        ))}
      </div>
    </main>
  );

}

export default Home
